import axios from 'axios'


const api = axios.create({
    baseURL: 'https://127.0.0.1:8000/',
})

export const login = async (url:string, usuario:string) => {
    try{
        return await api.post(url, usuario)

    }catch (error){
        console.log(error)
        throw error;
    }

}
export default api;
